ig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"166980","type":"CustomJS"},{"attributes":{"editor":{"id":"167120"},"field":"Equity Initial [$]","formatter":{"id":"167119"},"title":"Equity Initial [$]"},"id":"167077","type":"TableColumn"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"group":null,"items":[{"id":"166760"},{"id":"166783"},{"id":"166808"},{"id":"166835"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"166759","type":"Legend"},{"attributes":{"editor":{"id":"167126"},"field":"Return [%]","formatter":{"id":"167125"},"title":"Return [%]"},"id":"167080","type":"TableColumn"},{"attributes":{"editor":{"id":"167128"},"field":"Buy &amp; Hold Return [%]","formatter":{"id":"167127"},"title":"Buy &amp; Hold Return [%]"},"id":"167081","type":"TableColumn"},{"attributes":{},"id":"167169","type":"UnionRenderers"},{"attributes":{},"id":"167044","type":"AllLabels"},{"attributes":{"editor":{"id":"167122"},"field":"Equity Final [$]","formatter":{"id":"167121"},"title":"Equity Final [$]"},"id":"167078","type":"TableColumn"},{"attributes":{"editor":{"id":"167118"},"field":"Exposure Time [%]","formatter":{"id":"167117"},"title":"Exposure Time [%]"},"id":"167076","type":"TableColumn"},{"attributes":{},"id":"167129","type":"StringFormatter"},{"attributes":{"source":{"id":"166739"}},"id":"166744","type":"CDSView"},{"attributes":
